import * as C from './LandingStyling';
import { Link, useHistory } from 'react-router-dom';

export default function Landing() {
    const history = useHistory();

    return (
        <C.container>
            <C.hero>
                <C.button onClick={() => {history.push('/')}}>Get Started</C.button>
            </C.hero>
            <C.overview>
                <C.overviewGif/>
                <C.dropDownGif/>
            </C.overview>
            <C.tools/>
            <C.contact/>
        </C.container>
    );
}
